// frontend/src/FriendCard.js
import React from 'react';
import './FriendCard.css'; // スタイルシートをインポート

const FriendCard = ({ friend, onClose }) => {
  return (
    <div className="friend-card">
      <button className="close-button" onClick={onClose}>×</button>
      <h2 className="friend-name">{friend.name}</h2>
      <div className="friend-info">
        <p><strong>出身地:</strong> {friend.hometown}</p>
        <p><strong>MBTI:</strong> {friend.mbti}</p>
        <p><strong>趣味:</strong> {friend.hobby}</p>
        <p><strong>好きな食べ物:</strong> {friend.favoriteFood}</p>
      </div>
    </div>
  );
};

export default FriendCard;
